window.bookSummaryJSON = "<p>The follow-up to The Photo Album!</p> <p>On December 24th, 1998, fifteen-year-old Annie Ryan attended a Christmas party at her uncle William's palatial estate. She arrived at five, sat down for dinner at six, and then excused herself from the dinner table around 6:15.</p> <p>She was never seen again.</p> <p>William Ryan, looking for a new set of eyes, hires Bobby McGowan to take the case. After all, Bobby found his mother's killer after twenty years.</p> <p>How much more difficult could this be?</p> <p>THE OTHER ANNIE is a rollercoaster of a thriller with twists and turns that you'll never see coming.</p>"; 
